          <div className="section">
            <h2>Tur Başvurularım</h2>
            <table>
              <thead>
              <tr>
                <th>Durum</th>
                <th>Tarih</th>
                <th>Saat</th>
                <th></th>
              </tr>
              </thead>
              <tbody>
              <tr>
                <td>Onaylandı</td>
                <td>25.08.2024</td>
                <td>15.30-16.30</td>
                <td>
                  <a href="#" className="edit-button">
                    Turu iptal et
                  </a>
                </td>
              </tr>
              {/* Add more rows here */}
              </tbody>
            </table>
          </div>
          {/* Add more sections here */}
        </div>
      </div>
  );
};

export default App;
